void WaMap::Update(Vector2 offset)
{

	//DrawOwnScn();
	mOffset = { offset.x_,offset.y_ };

}


void WaMap::DrawOwnScn()
{

	for (int y = 0; y < MAP_Y; y++)
	{
		for (int x = 0; x < MAP_X; x++)
		{

			layer1 = wa_ground[y][x];
			layer2 = wa_build1[y][x];
			layer3 = wa_build2[y][x];
			layer4 = wa_build3[y][x];
			
			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[wa_ground[y][x]], true);
			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[wa_build1[y][x]], true);
			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[wa_build2[y][x]], true);
			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[wa_build3[y][x]], true);
			DrawFormatString(32 * x - mOffset.x_, 32 * y - mOffset.y_, GetColor(255, 255, 255), "%d", layer2);
		}
	}
}

bool WaMap::Init(void)
{

	if (LoadDivGraph("./image/A123.png", 4560, 30, 152, 32, 32, &mChipImage[0]) == -1)
	{
		return false;
	}

	return true;

}

